import Link from 'next/link'
// import fetch from 'isomorphic-unfetch'
const index = () => {
  return (
    <React.Fragment>
      <div>Hello</div>
      <Link href="/about">
        <a>About</a>
      </Link>
    </React.Fragment>
  )
}

Index.getInitialProps = async () => {
  const shows = await fetch('https://api.tvmaze.com/search/shows?g=sherlock')
    .then(res => res.json())
    .then(entry => entry.show)

  console.log('Rendering...', shows)

  return shows
}

export default index
